import React from "react";
import Nav from "react-bootstrap/Nav";
import styles from "./nav.module.scss";

const NavBar = () => {
  return (
    <Nav 
    variant="tabs" defaultActiveKey="/home" className={styles.Nav}>
      <Nav.Item className={styles.NavItem}>
        <Nav.Link className={styles.NavItemLink} href="/home">
          База анкет сотрудников
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-1">Общая база сотрудников</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-2">База сотрудников</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-3">Календарь сотрудников</Nav.Link>
      </Nav.Item>
    </Nav>
  );
};

export default NavBar;
